import { map } from 'lodash';
import { Image, Grid } from 'semantic-ui-react';
import Link from 'next/link';

export default function ListGames({ games }) {
    return (
        <div className="list-games">
            {map(games, (game) => (
                <Game game={game} />
            ))}
        </div>
    )
}

function Game({game}){
    return(
        <h3>{game.title}</h3>
    )
}
